import React from "react";
import Dashboard from "./components/Dashboard";
import Clients from "./components/Clients";
import Invoices from "./components/Invoices";
import Meetings from "./components/Meetings";

function App() {
  return (
    <div className="min-h-screen bg-gray-50">
      <header className="bg-blue-600 text-white p-4 text-2xl font-bold">ClientPulse</header>
      <main className="p-4 grid gap-6 grid-cols-1 md:grid-cols-2 lg:grid-cols-4">
        <Dashboard />
        <Clients />
        <Invoices />
        <Meetings />
      </main>
    </div>
  );
}

export default App;
